import TodoItem from "./TodoItem";
import "./TodoList.css";

 const TodoList = ({todo}) => {

     return (
        <div className="TodoList">
            <h4>Todo List 🌱</h4>
            <input className="searchbar" placeholder="검색어를 입력하세요" />
            <div className="list_wrapper">
                {todo.map((it) => (
                // map을 이용해 HTML 요소 반복하여 렌더링
                // <div>{it.content}</div>
                // map을 이용해 컴포넌트 반복
                    <TodoItem />
                ))}
            </div>
        </div>
     ) 
 };

 export default TodoList;
